import React from "react";

export default function Reservationcard(props){
    return(
        <div className="card text-center my-2 mx-0 px-3">
            <div className="card-header">
               <strong> Rezervacija za {props.application.arrangementName}</strong>
            </div>
            <div className="card-body">
                <h5 className="card-title">Special title treatment</h5>
                <p className="card-text">With supporting text below as a natural lead-in to additional content.</p>
            </div>
            <div className="card-footer">
                <button className="btn btn-primary mx-1" >Potvrdi</button>
                <button className="btn btn-danger mx-1" >Obrisi</button>
            </div>
        </div>
    );
}
